import React from 'react';
import OrderCSS from '../../assets/css/Order.css';

function Order() {
  return (
    <div>
        <div className='order-items-header'>
            <p id='order-items-header-text'>Thank you for ordering</p>
        </div>
        <div className='thank-you-for-ordering-box'>
            <p className='thank-you-for-ordering'>Thank you for ordering. We received your request.
Our staff will be contacting with you to tell next steps.</p>
        </div>
        <div className='submit-button-box'>
            <button id='submit-button-order'>SUBMIT</button>
        </div>
    </div>
  )
}

export default Order
